import React, { useContext } from 'react'
import AuthContext from '../Context/AuthContext'
import axios from 'axios'

import { Panel, Placeholder } from 'rsuite'

export default function ArticoliSalvati() {

    const { Paragraph } = Placeholder

    const { user, urlServer } = useContext(AuthContext)

    if (user === undefined) {
        return (
            <div>
                <Panel className="articolo" header={<Paragraph active />} shaded>
                    <Paragraph active />
                    <Paragraph active />
                    <Paragraph active />
                </Panel>
                <Panel className="articolo" header={<Paragraph active />} shaded>
                    <Paragraph active />
                    <Paragraph active />
                    <Paragraph active />
                </Panel>
                <Panel className="articolo" header={<Paragraph active />} shaded>
                    <Paragraph active />
                    <Paragraph active />
                    <Paragraph active />
                </Panel>
            </div>
        )
    }

    return (
        <div>
            {user.preferiti.map(id => {
                axios.post(`${urlServer}/post`, { id }).then(res => {
                    console.log("dati post preferiti", res.data)
                })

                return <p>Prova hahah</p>
            })}
        </div>
    )
}
